import { UserCircleIcon } from "@heroicons/react/outline"

export default function AccountSideBar() {
  return (
    <ul>
      <li><UserCircleIcon /><Link to="myaccount/">Home</Link></li>
      <li><Link to="myaccount/personalinfo/">Personal info</Link></li>
      <li><Link to="myaccount/data-and-personalization">Data & Privacy</Link></li>
      <li><a href="https://www.google.com/account/about/" target="_blank">Home</a></li>
    </ul>
  )
}
